import './App.css';
import Cell from './components/Сell/Сell'
import Line from './components/Line/Line';

function App() {
  let arrLine = []
  let arrCell = []

  for (let i = 0; i < 8; i++) {
    arrLine.push(i)
  }

  console.log(arrLine)

  return (
    <div className="App">
      {arrLine.map((el) => (
        <div>
          {arrCell.map((el) => (
            <div></div>
          ))}
        </div>
      ))}
    </div>
  );
}

export default App;
